window.bookSummaryJSON = "<p><b>You're sabotaging your own success - and Larry Winget can prove it!</b> </p>You think you know what you want in life. You've tried to achieve those things. But if you still don't have them, the culprit may be closer than you think. <p></p><p>In this perspective-altering program, the world-renowned Pitbull of Personal Development(tm), Larry Winget, exposes the things you are doing right now to unknowingly prevent your own success in the most important areas of your life: business, family, health, parenting, money, and more - and offers you his self-proven action plan for change. You'll learn about: </p><p></p><ul><li>The only five success rules you'll ever need. </li><li>How to eliminate stress once and for all. </li><li>The 10 ways you're sabotaging yourself right now. </li><li>Surprising ways to get more done at home and at work. </li><li>The bad-habit-breaking trick that will change your life instantly. </li><li>Simple steps to making fast improvements in your finances. </li></ul><p></p><p>By following the straightforward, commonsense plan Larry presents in this program, you'll be able to remove the one and only obstacle standing between you and the things you really want in life: <i>you</i>. If you're ready to make some real, lasting changes using simple solutions that <i>work</i>, his no-holds-barred style and radically un-radical process are what you've been waiting for! </p>"; 
